style.css:
@-moz-document domain("studio.youtube.com") {
/* YouTube Studio Dark Theme v9.1 by Lexan*/

/*Variables*/
:root {
        --none: rbga(0,0,0,0) !important;
        --accent-color: #FE4E45 !important;
    	--bg-color: #0F0F0F;
        --bg2-color: #141414 !important;
		--bg3-color: #222;
		--item-color: #333;
		--item-active-color: #777;
        --text-color: #fff;
		--text-darken-color: #ddd;
		--text-darken2-color: #aaa;
        --yt-blue: var(--accent-color) !important;
        --ytcp-focus: var(--accent-color) !important;
        --ytcp-studio-blue: var(--accent-color) !important;
        --ytcp-studio-light-blue: var(--accent-color) !important;
        --yt-spec-call-to-action: var(--accent-color) !important;
        --ytcp-medium-red: var(--accent-color) !important;
        --ytcp-studio-green: #0b0 !important;
        --ytcp-studio-light-green: #0b0 !important;
        --ytcp-themed-green: #0b0 !important;
        --ytcp-badge-green: #183F1A !important;
        --ytcp-themed-blue: var(--accent-color) !important;
        --ytcp-badge-blue: var(--item-color) !important;
    --ytcp-call-to-action: var(--accent-color) !important;
    --ytcp-call-to-action-raised-background: var(--accent-color) !important;
    --ytcp-link-color: #fff!important;
    --yt-spec-text-primary: var(--text-color) !important;
    --yt-spec-text-secondary: var(--text-darken2-color) !important;
}

body {
    background: var(--bg-color);
}

/*Header*/
    header.ytcp-header,ytcp-header.ytcp-entity-page /*Header shadow*/{
        box-shadow: rgba(15, 15, 15, 0.5) 0px 0px 0px 1px, rgba(15, 15, 15, 0.5) 0px 4px 4px;
    }

    #create-icon /*create button*/{
        background-color: #444;
        border: none !important;
        border-radius: 5px;
    }

    #create-icon:hover /*create button hover*/{
        background-color: var(--item-active-color);
        transition: .3s;
    }

/*Search Box*/
    input.ytcp-omnisearch /*search box*/{
        border: none;
        background-color: var(--bg2-color)
    }

/*Sidebar*/
    tp-yt-paper-icon-item.ytcp-navigation-drawer /*Text colour*/{
        color: var(--text-color)
    }   

        ytcp-navigation-drawer[keyboard-focus] .menu-item-link.ytcp-navigation-drawer:focus tp-yt-paper-icon-item.ytcp-navigation-drawer, ytcp-navigation-drawer[keyboard-focus] tp-yt-paper-icon-item.ytcp-navigation-drawer:focus, tp-yt-paper-icon-item.ytcp-navigation-drawer:hover, tp-yt-paper-icon-item.ytcp-navigation-drawer[submenu-open], tp-yt-paper-icon-item.iron-selected.ytcp-navigation-drawer /*Selected sidebar colour*/{
        background-color: var(--item-color);
        transition: .09s;
    }
    
/*Dashboard*/
    #page-title-container{ /*Widescreen fix*/
        max-width: 20000px !important;
    }
        
/*Content*/
    #header.ytcp-bulk-actions /*bulk actions header*/{
        background-color: #444 !important;
        color: var(--text-color) !important;
    }
    
    .label.ytcp-bulk-actions,ytcp-text-dropdown-trigger[dark] .dropdown-trigger-text.ytcp-text-dropdown-trigger, ytcp-text-dropdown-trigger[dark] .use-placeholder.ytcp-text-dropdown-trigger .dropdown-trigger-text.ytcp-text-dropdown-trigger{
        color: var(--text-color)
    }
    
        #row-container.ytcp-video-row.row-highlighted, #row-container.ytcp-video-row.row-highlighted .floating-column.ytcp-video-row /*Row hover colour*/{
    transition: .1s;
    background-color: var(--item-color);
}
    
    #row-container.ytcp-video-row.row-highlighted, #row-container.ytcp-video-row.row-highlighted .floating-column.ytcp-video-row /*Row hover colour*/{
    transition: .1s;
}

    .likes-container.ytcp-video-row .progress-fill.ytcp-video-row /*Like bar*/{
        background: #3095E3
    }

    .likes-container.ytcp-video-row .progress.ytcp-video-row /*Dislike bar*/{
        background: #ccc
    }

    .tablecell-comments.cell-body.ytcp-video-row a.row-highlighted.ytcp-video-row /*hover text*/{
        color: var(--text-color)
    }

/*Content tab - Editing videos*/
    #preview-panel.ytve-editor /*editor background*/{
        background-color: var(--none)
    }

#row-container.row-highlighted.ytgn-video-translation-row, #row-container.row-highlighted.ytgn-video-translation-row .floating-column.ytgn-video-translation-row/*subtitles row highlight*/{
    transition: .09s;
}

/*Playlists*/
    .floating-column.ytcp-table-header, ytcp-table-header /*header*/{
        background-color: var(--item-color) !important;
    }

/*Analytics*/
    .layout.vertical.yta-screen/*background fix*/{
        background-color: #1f1f1f
    }

    .row.yta-top-performing-entities:hover /*top videos rows*/{
        background-color: var(--item-color);
        transition: .1s;
    }

    #metrics-container.yta-belled-subscribers-card #belled-row.yta-belled-subscribers-card .metric-icon.yta-belled-subscribers-card /*bell icon*/{
        background-color: var(--item-color);
        border: none;
    }

    yta-audience-interests-card:not([keyboard-focus]) .no-focus-border.yta-audience-interests-card:hover,.layout.horizontal.yta-channel-competition-card:hover /*other videos list*/{
        background-color: var(--bg3-color);
        transition: .09s;
    }

/*Analytics - Advanced Mode*/
    #row-container.yta-explore-table-row,.layout.center.yta-explore-table-row, .layout.center-center.yta-explore-table-row,#row-container.yta-explore-ranking-table-row,.yta-explore.sticky-column.yta-explore-ranking-table-row,.layout.center.yta-explore-ranking-table-row, .layout.center-center.yta-explore-ranking-table-row /*Table background*/{
        background-color: var(--bg3-color) !important;
    }

    yta-title-cell[is-tappable] #entity-title-value.yta-title-cell,#footer.ytcp-text-menu /*Table text fix*/{
        color: var(--text-color);
    }

    .row.ytcp-multi-picker-entity-list:hover /*group hover*/{
        background-color: var(--item-color);
    }
    
    .scrollable.yta-explore-page{
        background-color: var(--bg3-color)
    }

/*Comments & Mentions*/
    ytcp-comment[highlighted] /*Comment highlight*/{
        background-color: var(--item-color);
        transition: .1s;
    }

    ytcp-comment[highlighted] #reply-endpoint.ytcp-comment, ytcp-comment[highlighted] #name.ytcp-comment,#name.ytcp-comment, #reply-endpoint.ytcp-comment,ytcp-comment-video-thumbnail[highlighted]:not([video-url='']) #video-title.ytcp-comment-video-thumbnail /*text fix*/{
        color: var(--text-color)
    }

ytcp-comment-button[is-icon-button]:not([disabled]):hover yt-icon.ytcp-comment-button /*view video button*/{
    color: var(--accent-color);
        transition: .1s;
}
    
    ytcp-comment-batch-action-bar /*select all comments*/{
        background: var(--item-color)
    }
    
    #selected-text.ytcp-comment-batch-action-bar /*comment selected text*/{
        color: var(--text-darken2-color)
    }
    
    .vertical-divider.ytcp-comment-batch-action-bar /*option divider color*/{
        border-left-color: var(--text-darken2-color)
    }

/*Subtitles*/
    #row-container.row-highlighted.ytgn-video-row, #row-container.row-highlighted.ytgn-video-row .floating-column.ytgn-video-row /*row hover*/{
        background-color: var(--item-color);
        transition: .09s;
    }

    ytcp-video-list-cell-video[is-highlighted] #video-title.ytcp-video-list-cell-video:not(.no-link),ytgn-toggle-languages-button.row-highlighted .languages-list.ytgn-toggle-languages-button /*text hover*/{
        color: var(--text-color)
    }
    
/*Copyright*/
    #row-container.row-highlighted.ytcc-discovered-reuploads-row,#row-container.row-highlighted.ytcr-history-complaint-row,#row-container.row-highlighted.ytcc-archive-row /*row highlight*/{
        background-color: var(--item-color);
        transition: .09s;
    }

/*Monetization*/
    .card-icon.ytmonet-overview,#videocam.ytsp-video-card /*icon backgrounds*/{
        background-color: var(--item-color)
    }

/*Customization*/
    .flavor-icon.ytcp-spotlight-section-item /*icon backgrounds*/{
        background-color: var(--item-color)
    }

/*Audio Library*/
    #row-container.row-highlighted.ytmus-library-row /*row highlight*/{
        background-color: var(--item-color);
        transition: .09s;
    }

    #row-container.ytmus-library-row /*removed dividers*/{
        border-bottom: none;
    }

    ytmus-library-row[is-current] #row-container.ytmus-library-row /*now playing*/{
        background-color: #330000
    }

    .track-info.ytmus-player .ytmus-player:first-child,.progress-bar.ytmus-player/*text fix*/{
        color: var(--text-color)
    }

    #artist.ytmus-player/*text fix*/{
        color: var(--text-darken2-color)
    }

/*Settings*/
    ytcp-navigation[keyboard-focus] .menu-item.ytcp-navigation[selected].ytcp-navigation:focus, .menu-item.ytcp-navigation[selected]/*selected tab*/{
        background-color: var(--item-color)
    }

    .menu-item.ytcp-navigation:hover/*highlighted tab*/{
        background-color: var(--item-color);
        transition: .09s;
    }

/*Upload Screen*/
    ytcp-video-metadata-editor.ytcp-uploads-dialog,h1.ytcp-uploads-dialog,#scrollable-content.ytcp-uploads-dialog /*background*/{
        background-color: var(--bg3-color)
    }

    ytcp-thumbnails-compact-editor-uploader[active] .upload-picker.ytcp-thumbnails-compact-editor-uploader button.ytcp-thumbnails-compact-editor-uploader /*thumbnail picker*/{
        background-color: var(--item-color);
        transition: .09s;
    }

.step.ytcp-stepper:not([disabled]).ytcp-stepper:hover /*step hover*/{
        background-color: rgba(255, 0, 0, .18);
        transition: .09s;
    }

    ytcp-badge[state="warning"] .container.ytcp-badge, ytcp-badge[state="warning"] .container.ytcp-badge tp-yt-iron-icon.ytcp-badge /*limited ads text*/{
        color: #ff3
    }

    ytcp-badge[state="warning"] .container.ytcp-badge/*limited ads back*/{
        background-color: #ffff3326
    }

    .container.ytcp-uploads-video-elements /*video elements buttons*/{
        background-color: var(--item-color)
    }

/*-------------------------------------------------Universal-------------------------------------------------*/
/*Drop down menus*/
    .paper-item.tp-yt-paper-item, .tp-yt-paper-item.tp-yt-paper-item:hover /*Hover fix*/{
        background: var(--item-color)
    }

/*Chip buttons*/

    ytcp-chip > ytcp-icon-button > .ytcp-icon-button {
        fill: var(--accent-color) !important;
    }   

/*Ripple Effects*/
    paper-ripple.paper-tab{
        color: var(--accent-color);
    }

    .wave.style-scope.paper-ripple{
        opacity: 0.3 !important;
    }

/*Checkboxes*/
    ytcp-checkbox-lit[indeterminate] #checkbox.ytcp-checkbox-lit, ytcp-checkbox-lit[checked] #checkbox.ytcp-checkbox-lit /*box*/{
        border: none
    }

    #checkmark.style-scope.ytcp-checkbox-lit.standard /*check*/{
        border-color: var(--bg2-color)
    }

/*Text Fields*/
    #outer.ytcp-form-input-container/*idle border*/{
        border: 1px solid var(--item-color);
        transition: .1s;
    }

    ytcp-form-input-container.focused #outer.ytcp-form-input-container, #outer.ytcp-form-input-container:hover/*hover*/{
        border-color: var(--text-darken2-color);
        transition: .1s;
    }

/*Read only text fields*/
.readonly-field.ytcp-channel-url{
    background-color: #282828;
}

/*Video player*/
    ytcp-video-player-timestamp /*timestamp*/{
        color: var(--text-color)
    }

/*Mini Calendar*/
    .calendar-day.today.ytcp-scrollable-calendar::after{
        box-shadow: inset 0 0 0 1px rgb(255 255 255 40%) !important;
    }

/*Selecting videos*/
ytcp-entity-card:hover, ytcp-entity-card:hover #selected-icon.ytcp-entity-card, ytcp-entity-card[keyboard-focus], ytcp-entity-card[keyboard-focus] #selected-icon.ytcp-entity-card, ytcp-entity-card[selected], ytcp-entity-card[selected] #selected-icon.ytcp-entity-card /*hover*/{
    background-color: var(--item-color);
    transition: .09s;
}

.playlists.ytcp-playlist-pick-dialog,.search.ytcp-playlist-pick-dialog,.videos.ytcp-video-pick-dialog,tp-yt-paper-tab.ytcp-video-pick-dialog:not(:last-child) /*background*/{
    background-color: var(--bg2-color)
}
    
/*Hover Items*/
    #tooltip.ytcp-paper-tooltip-placeholder{
        background-color: var(--item-color) !important;
        color: var(--text-color) !important;
    }
    
/*Callouts*/
    ytcp-feature-discovery-callout{
        --text-color: var(--text-color) !important;
    }
    
    #callout.ytcp-feature-discovery-callout,#divot.ytcp-feature-discovery-callout{
        background-color: var(--item-color);
        border-color: var(--item-color);
    }

/*Well congrats, you made it to the end, have a cookie*/
}
